const App = () => {
  const [serverErrors, setServerErrors] = useState([]);
  const [menu, setMenu] = useState();
  const [usrName, setUsrName] = useState("NA");

  useEffect(() => {
    console.log("From App");
    let fetching = false;
    let isLoggedIn = false;
    async function fetchData() {
      if (!fetching) {
        await axios.get("/loginDetails/isLoggedIn").then((response) => {
          if (response.data) isLoggedIn = true;
        });
      }

      if (isLoggedIn) {
        await axios
          .get("/menus?filter=usr")
          .then((response) => {
            //console.log(response.data);
            //console.log(typeof response.data);
            if (typeof response.data[0] !== "string") {
              //json menu data is an object
              //setData(response.data);
              setMenu(response.data[0]);
              //console.log(menu);
            }
            if (typeof response.data[1] === "string") {
              //json menu data is an object
              //setData(response.data);
              setUsrName(response.data[1]);
              //console.log(menu);
            }
          })
          .catch((error) => {
            //console.log(error);
            //console.log(error.response.status);
            //console.log(error.response.headers);
            if (error.response) setServerErrors(error.response.data.error);
            else setServerErrors(error.Error);
          });
      }

      if (isLoggedIn) {
        await axios
          .get("/usrs/loggedInUsr")
          .then((response) => {
            sessionStorage.setItem("usr", JSON.stringify(response.data));
          })
          .catch((error) => {
            if (error.response) setServerErrors(error.response.data.error);
            else setServerErrors(error.Error);
          });
      }
    }

    fetchData();
    //console.log(menu);
    return () => {
      fetching = true;
    };
  }, []);

  return (
    <Router basename={process.env.REACT_APP_ROUTER_BASE || ""}>
      <AppNavBar menu={menu} />
      <Switch>
        <Route path="/" exact={true} component={Home} />
        <Route path="/kitchen" component={KitchenSink} />
        <Route path="/files" component={FileList} />
        <Route
          path="/cbillTadaLtcs/printDebitClaims"
          exact={true}
          component={PrintDebitAdjReport}
        />
        <Route
          path="/payments/paymentSummary"
          exact={true}
          component={CmpSummary}
        />
         <Route path="/tasks/dsopAllocation/page"  exact={true} component = {DsopAllocation} />
        <Route
          path="/schedule3s/cmpGen"
          exact={true}
          component={CmpGeneration}
        />
        <Route
          path="/chequeSlips/dpsList"
          exact={true}
          component={DpSheetList}
        />
        <Route
          path="/cbillTadaLtcInputs/upload/advances"
          exact={true}
          component={UploadTadaAdvance}
